import React from "react";
import Movie from "./Movie"

const movieList = ({movies}) => {

    movieNodes = movies.map((movie) => {
        return (
            <Movie name = {movie.name} key = {movie.id}> {movie.text} </Movie>
        )
    })
    return(
        {movieNodes}
    )
}

export default movieList;
